import React, {Component} from 'react';
import { Route, NavLink, HashRouter } from "react-router-dom";

import Dashboard from '../ecommerce/Dashboard';
import Ecommerce_orders from '../ecommerce/Ecommerce_orders';


export default class Content extends Component {
    render(){
        return (
        <HashRouter>
            <content>
                <Route exact path="/ecommerce/dasboard" component={Dashboard}/>
                <Route exact path="/ecommerce/ecommerce_orders" component={Ecommerce_orders}/>
            </content>
        </HashRouter>
        )
    }
}
